import React from 'react';
import ReactDOM from 'react-dom';
import Button from '@material-ui/core/Button';

const Root: React.FC = () => {
  return <Button variant="contained">Hello World</Button>;
}

ReactDOM.render(<Root />, document.querySelector('#app'));

export default Root
